import React from 'react';

// Components
import AboutScreen from './AboutScreen';

// React Route
import {
	BrowserRouter as Router,
	Switch,
	Route
} from "react-router-dom";

const AppRouter = () => {
	return (
		<Router>
			<div>
				<Switch>
					<Route path="/about" component={ AboutScreen } />
				</Switch>
			</div>
		</Router>
	);
}

export default AppRouter;
